    >
      <Stack.Navigator initialRouteName="EventPostFlatList">
        <Stack.Screen
          name="EventPostFlatList"
          component={EventPostFlatList}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="EventPostFullView"
          component={EventPostFullView}
          options={{ title: "" }}
        />
